// frontend/src/pages/ClientsPage.js
import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import api from "../api";

function ClientsPage() {
  const [clients, setClients] = useState([]);
  const [search, setSearch] = useState("");
  const [loading, setLoading] = useState(false);
  const [debugMsg, setDebugMsg] = useState("");

  const fetchClients = async () => {
    try {
      setLoading(true);
      setDebugMsg("");
      const res = await api.get("/clients");
      // Debug log so you can inspect exact response shape
      console.log("DEBUG /api/clients response:", res.data);
      setDebugMsg("Check console: /api/clients response logged (see network/console).");

      // normalize id field to always have ._id
      const normalized = (Array.isArray(res.data) ? res.data : []).map((c) => {
        // If the object already has _id, keep it; if it has id, copy it to _id.
        if (!c._id && c.id) {
          return { ...c, _id: c.id };
        }
        // if neither, keep as is (we'll disable open)
        return c;
      });

      setClients(normalized);
    } catch (err) {
      console.error("Error fetching clients:", err);
      setDebugMsg("Error fetching clients — check backend at /api/clients or open console.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchClients();
    // eslint-disable-next-line
  }, []);

  const handleSearch = async (e) => {
    const value = e.target.value;
    setSearch(value);
    if (!value) {
      fetchClients();
      return;
    }
    try {
      const res = await api.get(`/clients/search?query=${encodeURIComponent(value)}`);
      console.log("DEBUG /api/clients/search response:", res.data);
      const normalized = (Array.isArray(res.data) ? res.data : []).map((c) => {
        if (!c._id && c.id) return { ...c, _id: c.id };
        return c;
      });
      setClients(normalized);
    } catch (err) {
      console.error("Search error:", err);
    }
  };

  return (
    <div>
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h3 className="mb-0">Clients</h3>
        <div>
          <button className="btn btn-outline-secondary me-2" onClick={() => { setSearch(""); fetchClients(); }}>Refresh</button>
          <button className="btn btn-primary" onClick={() => {
            // show simple add dialog via native prompt for quick test (optional)
            alert("Use the + Add Client button in UI to add clients.");
          }}>+ Add Client</button>
        </div>
      </div>

      <div className="mb-3">
        <input className="form-control" placeholder="Search by name or phone..." value={search} onChange={handleSearch} />
      </div>

      {debugMsg && <div className="alert alert-info">{debugMsg}</div>}

      <div className="row">
        {loading ? (
          <div className="text-center py-4">Loading...</div>
        ) : clients.length === 0 ? (
          <div className="text-muted">No clients found.</div>
        ) : (
          clients.map((c, idx) => {
            const _id = c._id ?? c.id ?? null;
            return (
              <div key={_id || `noclient-${idx}`} className="col-md-4 mb-3">
                <div className="app-card h-100">
                  <div>
                    <h5 className="mb-1">{c.name || "<no name>"}</h5>
                    <div className="text-muted small">Phone: {c.phone || "—"}</div>
                    {c.notes && <div className="mt-2 small">{c.notes}</div>}
                  </div>

                  <div className="mt-3 d-flex justify-content-between align-items-center">
                    {_id ? (
                      <Link to={`/clients/${_id}`} className="btn btn-outline-primary btn-sm">Open</Link>
                    ) : (
                      <button className="btn btn-outline-secondary btn-sm" disabled>Open</button>
                    )}
                    <div className="text-muted small">{c.createdAt ? new Date(c.createdAt).toLocaleDateString() : ""}</div>
                  </div>
                </div>
              </div>
            );
          })
        )}
      </div>
    </div>
  );
}

export default ClientsPage;
